/**"SoundManager" */
const sm = (function () {
    const _ctx = new AudioContext();
    // iPhoneではAlertやConfirmを読んだときにsuspendされるぽい？
    // これをすると別タブに行った時も止まらなくなる。
    // _ctx.addEventListener("statechange", _ctx.resume);
    // DATA URLでエンコーディングされた音声データ
    const _srcList = Object.values(ep.soundList);

    /**@type AudioBuffer[] */
    let _audioBufferList;
    let _isLoaded = false;
    /**@type {AudioBufferSourceNode} */

    (async function _loadAsync() {
        _audioBufferList = await Promise.all(_srcList.map(async (key) => {
            var src = ep.soundResourceList
                .find(e => e.name === key)
                .url;

            // buf: 音声データのバイナリデータ
            // return: バイナリデータをでコードしたデータ(AudioBuffer)
            return fetch(src)
                .then(response => response.arrayBuffer())
                .then(buf => _ctx.decodeAudioData(buf));
        }));
        _isLoaded = true;
        // BGMはここで再生
        _startBgm();
    })();

    //for iOS
    const touchTarget = document.getElementById("bb2021");
    touchTarget.addEventListener("touchend", _begin);
    //for PC (サーバー起動すれば不要だがローカルファイルだと必要)
    touchTarget.addEventListener("click", _begin);
    function _begin() {
        _ctx.resume().then(() => {
            if (!_isPlayingBgm()) { return; }
            touchTarget.removeEventListener("touchend", _begin);
            touchTarget.removeEventListener("click", _begin);
        });
    }

    let _bgmNode;
    let _bgmGainNode = new GainNode(_ctx);
    _bgmGainNode.connect(_ctx.destination);
    function _startBgm() {
        _bgmNode = new AudioBufferSourceNode(_ctx, {
            buffer: _audioBufferList[0],
            loop: true
        });
        _bgmNode.connect(_bgmGainNode);
        _bgmNode.start();

    }
    function _isPlayingBgm() { return _ctx.state !== "suspended"; }


    let _seGainNode = new GainNode(_ctx);
    _seGainNode.connect(_ctx.destination);
    function _playSeAsync(i) {
        // https://developer.mozilla.org/ja/docs/Web/API/AudioBufferSourceNode
        // AudioBufferSourceNode は一度しか再生できません。
        // つまり、同じ音を再び再生したいのであれば、 start() を呼び出すたびに新しいノードを作成する必要があります。
        // 幸いなことに、これらのノードはとても安価に作成でき、実際の AudioBuffer は複数回のサウンド再生に再利用することができます。
        // 実際、これらのノードは「使い捨て」で使用することができます。
        // ノードを作成し、 start() を呼び出して音の再生を始め、わざわざそのノードの参照を保持する必要はないでしょう。
        // このノードは適切なタイミングで自動的にガベージコレクションされますが、それはサウンドの再生が完了した後しばらくしてからになります。
        return new Promise(resolve => {
            if (!_isLoaded) {
                resolve();
                return;
            }
            //iPhoneにて自動再生ポリシーで再生中止しているNodeがたまり、
            // 再生始まった瞬間に一気に再生されるのを防ぐ。
            if (_ctx.state === "suspended") {
                resolve();
                return;
            }
            const sourceNode = new AudioBufferSourceNode(_ctx, {
                buffer: _audioBufferList[i],
            });
            sourceNode.connect(_seGainNode);
            sourceNode.addEventListener("ended", resolve);
            sourceNode.start();
        });
    }
    return {
        callItemSeAsync() { return _playSeAsync(1); },
        callPadSeAsync() { return _playSeAsync(2); },
        callWallSeAsync() { return _playSeAsync(3); },
        callHoldoffSeAsync() { return _playSeAsync(4); },
        callFailSeAsync() { return _playSeAsync(5); },
        callStageClearSeAsync() { return _playSeAsync(6); },
        callGameClearSeAsync() { return _playSeAsync(7); },
        stopBgm() { _bgmNode.stop(); },
        restartBgm: _startBgm,
        // iPhone対応のため
        // AlertやConfirmのあと呼ぶ
        resumeAudioContext() { return _ctx.resume(); },
        get isPlayingBgm() { return _isPlayingBgm(); },
        /** @param {number} value */
        set bgmScale(value) { _bgmGainNode.gain.setValueAtTime(value, _ctx.currentTime); },
        /** @param {number} value */
        set seScale(value) { _seGainNode.gain.setValueAtTime(value, _ctx.currentTime); },
    }
})();


